import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        users: [],
        sample:[
            {
                name:'Tonoy',
                age:24,
                home:'kg'
            },
            {
                name:'Tonoy',
                age:24,
                home:'kg'
            }
        ]
     }

     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/users')
         .then(response => {
             console.log(response)
              this.setState({
                 users: response.data
             })
         })
         .catch(error => {
             console.log(error)
         })
     }

    render() { 

        let { users } = this.state

        return ( 
            <div>
                <p>Name: {users.name}</p>
                <p>{this.state.sample[0].name}</p>
            </div>
         );
    }
}

export default Main;
